import React from "react";
import "../Components/style/signin.css";

function Signin() {
  return (
    <div className="m">
      <a href="#openModalSignin">Sign In</a>

      <div id="openModalSignin" class="modalDialog">
        <div>
          <a href="#close" title="Close" class="close">
            X
          </a>
          <h2>Sign In</h2>
        </div>
      </div>
    </div>
  );
}

export default Signin;
